 ('13', '13', 'en_us', 'Land Clearing', '<p>Land clearing is often needed to recapture valuable pasture land that has been overtaken by trees and brush. It is also needed for clearing building sites, and keeping roadways, lots and waterways clear and safe. In addition to providing these services for individual landowners, we also can provide maintenance for various companies and municipalities on a regular and routine basis.</p>', '<iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/P8IDmTOqudM\" frameborder=\"0\" allowfullscreen></iframe>', NULL, NULL, NULL, '2017-03-15 03:38:48', '2017-04-19 23:33:37', '3eb0638d-db5a-4823-85c4-e43a6209e71b'),
 ('14', '14', 'en_us', 'Trjranch Black', NULL, NULL, NULL, NULL, NULL, '2017-03-15 04:05:43', '2017-03-15 04:05:43', '74b812ec-44aa-4a12-932d-c93996dec0c0'),
