 ('17', '17', 'en_us', 'Trjranch 1', NULL, NULL, NULL, NULL, NULL, '2017-03-15 04:28:34', '2017-03-15 04:28:34', 'dc0c6136-5dcd-4ae3-9764-711ae8365630'),
 ('18', '18', 'en_us', 'About Us', '<p>We work with you, the Oklahoma Landowner, to tackle the environmental and safety challenges of the cedar tree infestation and the displacement of our native agriculture, recreational and wildlife conservation land. Land has always been and will always be one of Our Greatest Investments. Our job is to help you preserve your investment both for you and your family for many years to come. To do so, we will utilize the best equipment and Oklahoma grit to get the job done right. And yes, we can harvest and mill your trees into beautiful custom lumber!</p>', '', NULL, NULL, NULL, '2017-03-15 04:50:00', '2017-03-15 04:53:41', '447afb3b-3075-460d-bc2a-16bec10bf339'),
 ('19', '19', 'en_us', 'The Cedar Tree Problem', '<p><strong>Cedar Tree</strong> is very popular in many geographic locations around the world. The family has many different varieties. The tallest specimen can mature at 40 - 50 feet (14 - 17 meters).</p>\n<p>There have been readers interested in this plant family. Many of you have written in about problems such as <strong>branches getting brittle and leaves turning brown.</strong></p>\n<p>As we know, not only new plant specimens but established trees and shrubs can <strong>go into shock</strong>. They can have their leaves turn yellow or brown.</p>\n<p>Below are some of your questions and my recommendations for you. Some of you have had the same problems. There are some basic steps for each of you to take.</p>\n<h3>Planting Problems</h3>\n<p>Spreading and rapid grow eliminate grazing space, prevent farming... etc etc.</p>\n<h3>Insects and Animals</h3>\n<p>Juniper scale, mites, root weevil and cypress tip moth are among the insects that are attracted to cedar trees. Symptoms of insect infestation include yellow or browning foliage, white spun cocoons, depleted plant sap and black sooty mold. Mice, other rodents and even dogs enjoy munching on cedar trees. They strip the bark and chew the tree which can cause the branches on one side of the tree or the overall tree to die.</p>\n<h3>Allergies</h3>\n<p>Mountain cedar trees create pollen that causes severe allergies from December through February to people living in central Texas, Oklahoma, Arkansas, New Mexico and northern Mexico. Pollen from mountain cedar trees affects the lining tissue of a person\'s lungs, nose and eyes, with resulting discomfort and allergic symptoms that include runny nose, sneezing, nasal blockage, headaches, fatigue, excess tearing and itchy eyes. Residents of central Texas are most vulnerable during the pollen season as there are a significant number of mountain cedars growing there. Allergic reactions to cedar are not limited to the mountain cedar or to pollen; shavings from cedar trees that are used in dog beds may also lead to allergies in humans.</p>\n<p><br /></p>', '', NULL, NULL, NULL, '2017-03-15 04:50:10', '2017-03-31 17:50:04', 'd6bc23df-603b-4d67-a4fe-27978d58fcb9'),
