 ('19', '18', '9', '1', 'en_us', '2', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"About Us\",\"slug\":\"about-us\",\"postDate\":1489553400,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>We work with you, the Oklahoma Landowner, to tackle the environmental and safety challenges of the cedar tree infestation and the displacement of our native agriculture, recreational and wildlife conservation land. Land has always been and will always be one of Our Greatest Investments. Our job is to help you preserve your investment both for you and your family for many years to come. To do so, we will utilize the best equipment and Oklahoma grit to get the job done right. And yes, we can harvest and mill your trees into beautiful custom lumber!<\\/p>\",\"4\":\"\",\"5\":\"\"}}', '2017-03-15 04:53:41', '2017-03-15 04:53:41', '267e0f49-3fc6-4730-a522-7729baa7a6a7'),
 ('20', '19', '9', '1', 'en_us', '2', '', '{\"typeId\":\"9\",\"authorId\":\"1\",\"title\":\"The Cedar Tree Problem\",\"slug\":\"the-cedar-tree-problem\",\"postDate\":1489553400,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p><b>Cedar Tree<\\/b>&nbsp;is very popular in many geographic locations around the world. The family has many different varieties. The tallest specimen can mature at 40 - 50 feet (14 - 17 meters).<\\/p>\\r\\n<p>There have been readers interested in this plant family. Many of you have written in about problems such as&nbsp;<b>branches getting brittle and leaves turning brown.<\\/b><\\/p>\\r\\n<p>As we know, not only new plant specimens but established trees and shrubs can&nbsp;<b>go into shock<\\/b>. They can have their leaves turn yellow or brown.<\\/p>\\r\\n<p>Below are some of your questions and my recommendations for you. Some of you have had the same problems. There are some basic steps for each of you to take.<\\/p><h3>Planting Problems<\\/h3>\\r\\n<p>Spreading and rapid grow eliminate grazing space, prevent farming... etc etc.<\\/p>\\r\\n<h3>Insects and Animals<\\/h3>\\r\\n<p>Juniper scale, mites, root weevil and cypress tip moth are among the insects that are attracted to cedar trees. Symptoms of insect infestation include yellow or browning foliage, white spun cocoons, depleted plant sap and black sooty mold. Mice, other rodents and even dogs enjoy munching on cedar trees. They strip the bark and chew the tree which can cause the branches on one side of the tree or the overall tree to die.<\\/p>\\r\\n<h3>Allergies<\\/h3>\\r\\n<p>Mountain cedar trees create pollen that causes severe allergies from December through February to people living in central Texas, Oklahoma, Arkansas, New Mexico and northern Mexico. Pollen from mountain cedar trees affects the lining tissue of a person\'s lungs, nose and eyes, with resulting discomfort and allergic symptoms that include runny nose, sneezing, nasal blockage, headaches, fatigue, excess tearing and itchy eyes. Residents of central Texas are most vulnerable during the pollen season as there are a significant number of mountain cedars growing there. Allergic reactions to cedar are not limited to the mountain cedar or to pollen; shavings from cedar trees that are used in dog beds may also lead to allergies in humans.<\\/p><p><br><\\/p>\",\"4\":\"\",\"5\":\"\"}}', '2017-03-15 04:56:54', '2017-03-15 04:56:54', '652ef7a1-75a2-4f29-b00e-cc19198b24c0'),
