 ('18', 'field', '1', 'en_us', ' we work with you the oklahoma landowner to tackle the environmental and safety challenges of the cedar tree infestation and the displacement of our native agriculture recreational and wildlife conservation land land has always been and will always be one of our greatest investments our job is to help you preserve your investment both for you and your family for many years to come to do so we will utilize the best equipment and oklahoma grit to get the job done right and yes we can harvest and mill your trees into beautiful custom lumber '),
