 ('18', 'field', '5', 'en_us', ''),
 ('19', 'field', '1', 'en_us', ' cedar tree is very popular in many geographic locations around the world the family has many different varieties the tallest specimen can mature at 40 50 feet 14 17 meters there have been readers interested in this plant family many of you have written in about problems such as branches getting brittle and leaves turning brown as we know not only new plant specimens but established trees and shrubs can go into shock they can have their leaves turn yellow or brown below are some of your questions and my recommendations for you some of you have had the same problems there are some basic steps for each of you to take planting problems spreading and rapid grow eliminate grazing space prevent farming etc etc insects and animals juniper scale mites root weevil and cypress tip moth are among the insects that are attracted to cedar trees symptoms of insect infestation include yellow or browning foliage white spun cocoons depleted plant sap and black sooty mold mice other rodents and even dogs enjoy munching on cedar trees they strip the bark and chew the tree which can cause the branches on one side of the tree or the overall tree to die allergies mountain cedar trees create pollen that causes severe allergies from december through february to people living in central texas oklahoma arkansas new mexico and northern mexico pollen from mountain cedar trees affects the lining tissue of a person s lungs nose and eyes with resulting discomfort and allergic symptoms that include runny nose sneezing nasal blockage headaches fatigue excess tearing and itchy eyes residents of central texas are most vulnerable during the pollen season as there are a significant number of mountain cedars growing there allergic reactions to cedar are not limited to the mountain cedar or to pollen shavings from cedar trees that are used in dog beds may also lead to allergies in humans '),
